import React from 'react'
import "./Profile.css"
import { useState } from 'react'
function Profile() {
    let[state,setState]=useState("data:image/jpeg;base64,");
    let[data,setData]=useState({
        name:"",
        gender:"",
        desig:"",
        description:""
    })
    let[theme,setTheme]=useState({
        bgcolor:"",
        text:"",
        title:""
    })
    const changeTheme=(event)=>{
  if(event.target.checked)
  {
     setTheme({
        bgcolor:'black',
        text:'white',
        title:'CHANGED TO DARK MODE'
     })
  }
  else{
     setTheme({
        bgcolor:'white',
        text:'black',
        title:'CHANGED TO LIGHT MODE'
     })
  }
    }
    const changeRajat=()=>{
        setState("data:image/jpeg;base64,");
         setData({
            name:"RAJAT RAY",
            gender:"MALE",
            desig:"MANAGER",
            description:"HE IS A DYNAMIC LEADER"
         }) 
    }
      const changeRiya=()=>{
        setState("data:image/jpeg;base64,");
           setData({
            name:"RIYA SHARMA",
            gender:"FEMALE",
            desig:"MANAGER",
            description:"SHE IS A FLEXIBLE LEADER"
         })  
    }
    return (
    <div className='mainContainer'>
    
      <div className='leftContainer'>
      <img src={state}
      height={300}
      width={300}
      alt='NO IMAGE'/>
      </div>
      <div className='rightContainer' style={{backgroundColor:theme.bgcolor,color:theme.text}}>
         <h2>NAME:{data.name}</h2>
         <h2>GENDER:{data.gender}</h2>
         <h2>DESIGNATION:{data.desig}</h2>
         <h2>DESCRIPTION:{data.description}</h2>
        <button onClick={changeRajat}>RAJAT</button> &nbsp;&nbsp;
        <button onClick={changeRiya}>RIYA</button>
        <br/><br/>
        <input type='checkbox' onChange={changeTheme}/>
        <h2>TITILE:{theme.title}</h2>
      </div>
    </div>
  )
}

export default Profile
